- fields:
    label: buccinator muscle
    obo_definition: The buccinator is a muscle that is attached to the mandible, skin,
      pterygomandibular raphe and maxilla, and is innervated by Cranial Nerve VII
      and participates in oropharyngeal behavior.
    rdfs_comment: 'The attachments of this muscle vary in mammals. The modiolus is
      a structure (or anatomical cluster) clearly present in humans and other primates
      but it''s presence is less certain in other mammals (see Tomo et al., 2002 -
      DOI 10.1002/ar.10090; Diogo et al., 2008 - doi: 10.1111/j.1469-7580.2008.00953.x;
      Burrows et al., 2011 - DOI 10.1002/ar.21355; Lightoller, 1940, 1942). In cats
      (Tomo et al., 2002) there is no attachment to the maxilla.'
    rdfs_subClassOf_ancestors: []
    uri: http://purl.obolibrary.org/obo/MFMO_0000002
