- fields:
    label: zygomaticus minor
    obo_definition: Facial muscle attached to the orbicularis oris muscle, anterior
      root of the zygomatic arch (zygomatic bone or maxilla), and skin in the region
      of the caudal border of the orbicularis oculi muscle. The muscle is often described
      as having two heads, one attached to the maxilla and the other attached to the
      skin overlying the orbicularis oculi.  In many mammals this muscle also has
      an attachment to the cartilage of the external ear, in which case it is called
      the auriculolabialis superior. See Diogo 2008; Diogo et al., 2009; Burrows et
